#Requires -Version 2

$Projectile = ""
$Barbershop = ""
$Glissandos = ""
$Potpourris = ""
$Exhaustive = ""
$Horsewoman = ""
$Blackberry = ""

$Modules = @($Projectile,$Barbershop,$Glissandos,$Potpourris,$Exhaustive,$Horsewoman,$Blackberry)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    if ($_ -like "H4s*") {
        $Decoded = ConvertFrom-Gzip -Bytes $Decoded
    }
    else {
        $Decoded = [Text.Encoding]::UTF8.GetString($Decoded)
    }
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decoded)
    . $ScriptBlock
}
